import React, {Component, Suspense} from 'react';
import { Card, Col, Row } from 'reactstrap';
import {Provider} from 'react-redux'
import {createStore} from "redux";
import UserReducer from "../../reducer/UserReducer";
import UserTable from "./UserTable";
import {
  AppAside,
  AppFooter,
  AppHeader, AppSidebar, AppSidebarFooter,
  AppSidebarForm,
  AppSidebarHeader, AppSidebarMinimizer,
} from "@coreui/react";
const DefaultAside = React.lazy(() => import('../../containers/DefaultLayout/DefaultAside'));
const DefaultHeader = React.lazy(() => import('../../containers/DefaultLayout/DefaultHeader'));

export default class extends Component{
  loading = () => <div className="animated fadeIn pt-1 text-center">Loading...</div>

  render() {
    const userStore=createStore(UserReducer);
    return (
      <div className="animated fadeIn ">
        <DefaultHeader/>

        <div className="app-body">
          <AppSidebar fixed display="lg"/>

        <main className="main">
          <Provider store={userStore}>
            <Row>
              <Col>
                <Card>
                  <UserTable/>
                </Card>
              </Col>
            </Row>
          </Provider>
        </main>

        </div>

      </div>
    );
  }
}
